window.bookSummaryJSON = "<p>Charm is the key to the world. Charisma, magnetism, sex appeal - that \"it\" factor that can't be described. Nolan Delaney has it is spades. The infamous Mr. Romantic. And maybe he is out of my league, but I'm going to give it the old college try anyway. Because I didn't travel 2,000 miles for a job interview at his request just to be put out like trash. Don't underestimate me, Mr. Delaney. I'm really not as innocent as I look.&nbsp;</p> <p><b>**Includes a special bonus note read by the author. </b></p>"; 
